What is the output?
interface Printable {
    void print();
}
class Test implements Printable {
    public void print() { System.out.println("Test"); }
}
new Test().print();,Test,Compilation error,null,Nothing printed

What is the result?
interface Calculator {
    default int add(int a, int b) {
        return a + b;
    }
}
class Calc implements Calculator {}
System.out.println(new Calc().add(5, 10));,15,Compilation error,0,Method not found

